export const GamePlayer = ({gamedata, gameurl, Ratio=1.32}) =>{
    return dispatch =>{
        dispatch({
            type : "GAME_PLAYER",
            gamedata : gamedata,
            gameurl : gameurl,
            Ratio : Ratio,
            state : true,
        })
    }
}

export const GameExit = (state)=>{
    return dispatch =>{
        dispatch({
            type : "GAME_EXIT",
            payload : false
        })
    }
}
